import React from 'react'
import './TrendCard.css'
import { TrendData } from '../../Data/TrendData.js'

const TrendCard = () => {
  return (
    <div className='TrendCard'>
        <h3>Trends For You</h3>
        {TrendCard.map((trend)=>{
            return(
                <div className="trend">
                    <span></span>
                </div>
            )
        })}
    </div>
  )
}

export default TrendCard
